import React from 'react'
import {View, StyleSheet, Text} from 'react-native'

function TrackDetailScreen(props) {
  return (
    <Text style={{ fontSize: 48}} >
      Track Detail Screen
    </Text>
  )
}

const styles = StyleSheet.create({})

export default TrackDetailScreen
